import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <footer className="bg-gray-800 text-gray-300 mt-auto py-8">
      <div className="container mx-auto px-4">
        <div className="flex flex-col md:flex-row justify-between items-center md:items-start text-center md:text-left">
          <div className="mb-4 md:mb-0">
            <h5 className="font-bold text-white text-lg">B.Tech Exam Portal</h5>
            <p className="mt-2 text-sm">Â© {new Date().getFullYear()} All rights reserved.</p>
          </div>
          <div className="mb-4 md:mb-0">
            <h5 className="font-bold text-white text-lg mb-2">Quick Links</h5>
            <ul className="space-y-1 text-sm">
              <li><Link to="/" className="hover:text-white transition-colors duration-200">Home</Link></li>
              <li><Link to="/about" className="hover:text-white transition-colors duration-200">About Us</Link></li>
              <li><Link to="/contact" className="hover:text-white transition-colors duration-200">Contact</Link></li>
            </ul>
          </div>
          <div className="mb-4 md:mb-0">
            <h5 className="font-bold text-white text-lg mb-2">Follow Us</h5>
            <div className="flex justify-center md:justify-start space-x-4">
              {/* Placeholder for social media icons */}
              <a href="#" className="hover:text-white transition-colors duration-200">
                {/* Social icon SVG */}
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="currentColor">...</svg>
              </a>
              <a href="#" className="hover:text-white transition-colors duration-200">
                {/* Social icon SVG */}
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="currentColor">...</svg>
              </a>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
